(function() {
  var KeyBindingResolverView;

  KeyBindingResolverView = require('./keybinding-resolver-view');

  module.exports = {
    keybindingResolverView: null,
    activate: function(state) {
      return this.keybindingResolverView = new KeyBindingResolverView(state);
    },
    deactivate: function() {
      return this.keybindingResolverView.destroy();
    },
    serialize: function() {
      return this.keybindingResolverView.serialize();
    }
  };

}).call(this);
